import React from 'react'
import { Typography } from '@material-ui/core';
import { Button } from '@material-ui/core';

export default function Create() {
  return (
    <div>
      <Typography
        variant='h6'
        component='h2'
        color='textSecondary'
        gutterBottom
      >
        Create a new Note
      </Typography>
      <Button variant='contained' type='submit'>Submit</Button>
    </div>
  )
}
